import axios from "axios"

export default async function addFaculty() {
	try {
		let token = null
		const tokenRes = await axios.post("https://sp-api-test.alun.app/api/token", {
			username: "username",
			password: "password"
		})

		if(tokenRes.data.success) {
			token = tokenRes.data.result
			console.log(token)
			try {
				const response = await axios.post("https://sp-api-test.alun.app/api/faculty/basic-info/add/personal", {
					lastName: "Catamin",
					firstName: "Jane Elizabeth",
					middleName: "Cutamora",
					dateOfBirth: "2013-06-18",
					placeOfBirth: "Manila",
					gender: "Female",
					permanentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					presentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					mobile: "09228195773",
					landline: "83539084",
					email: "jane@bulacan.ph",
					civilStatus: "Single",
					religion: "Baptist",
					emergencyContactPerson: "Loloy Catamin",
					emergencyContactNumber: "09228195771"
				}, {
					headers: {
						Authorization: `Bearer ${token}`
					}
				})
				console.log("haha")
				if (response.data.success) {
					console.log("aY PASOK")
					// return response.data
				} else {
					console.error("AY MALI")
					// return response.data
				}
			} catch (err) {
				// console.error(err)
				return err
			}
		}
	} catch (err) {
		// console.error(err)
		return err
	}
}
